INSERT INTO weixin_article ( `id`, `cate_id`, `title`, `colors`, `author`, `tags`, `img`, `intro`, `info`, `comments`, `hits`, `ordid`, `add_time`, `last_time`, `status` ) VALUES  ('26','2','2015年，垂直微分销唱响微商3.0时代','','admin','213','','微商发展至今，经历了三个阶段：靠在朋友圈大量刷屏，透支了朋友间信任的1.0时代；披着互联网外衣，以囤货、压货为特点，只发展下级批发商，产品始终无法产生终端消费，疯子骗傻子的2.0时代；而今，经历过洗炼、沉淀后，将全面进入零囤货、零压力、零风险、统一平台，操作简易方便的3.0时代，让我们拭目以待！','<br />
INSERT INTO weixin_article ( `id`, `cate_id`, `title`, `colors`, `author`, `tags`, `img`, `intro`, `info`, `comments`, `hits`, `ordid`, `add_time`, `last_time`, `status` ) VALUES  ('27','2','最专业的分销平台','','admin','12313123','','微分销是一款\"微商城+微分销\"多层级一体化微信分销成交平台。基于朋友圈的传播，轻松带领成千上万的微信用户一起为您销售产品。让分销商发展分销商，实现店中店模式。','<p>
INSERT INTO weixin_article ( `id`, `cate_id`, `title`, `colors`, `author`, `tags`, `img`, `intro`, `info`, `comments`, `hits`, `ordid`, `add_time`, `last_time`, `status` ) VALUES  ('28','4','微分销怎么做（企业与个人做法不同）','','admin','','','微分销怎么做,我们都知道微分销不管是对于企业来说还是对于个人微商来说都是非常好的微信营销方式,下面就分别谈谈个人微分销怎么做以及企业微分销怎么做....','微分销怎么做，我们都知道微分销不管是对于企业来说还是对于个人微商来说都是非常好的微信营销方式，下面就分别谈谈个人微分销怎么做以及企业微分销怎么做。
