<p>
	　　微信分销营销方法
</p>
<p>
	　　1.个人品牌既然能和你成为朋友，能够加入你的朋友圈，肯定是认可你这个人，或者是想和你成为朋友。不管是认识的，还是不认识的。所以你要别人知道你
是怎么的一个人，知道微信背后的是一个活生生的人。做销售，首先要把自己推销出去。所以你的微信不仅只发产品的宣传内容，还要把你的个人生活、生活感悟、
其他分享，让人家知 道这个微信后面的是一个怎么样的人。分享的东西必须是正面的、积极的、正能量的，塑造你的个人品牌。
</p>
<p>
	　　2.情感策略大家知道了你是一个怎么样的人，对你产生了好感，这个适合你就可以很好的利用人家对你的好印象，进行一些产品的推销，要慢慢的，循序渐进，不要一天发很多产品的宣传，这样很容易让人家反感。
</p>
<p>
	　　3.分享技术当朋友购买你的产品之后，你要第一时间分享出去，让人家看到原来有这么多人购买，并且还有一个不错的购物体验，购买后和收到货后都要分享
出去。分享的时候一定要把订单信息、对话内容截图放上去，显得更真实，这是一个刺激其他朋友购买的有效方式。如某个朋友帮你买了，你分享了，而另一个朋友
和你，还有这个购买 的都是朋友，他看到后，觉得应该要支持一下你。
</p>
<p>
	　　4.互动环节在朋友圈里，你要让朋友圈好友知道你的存在，如你的好友发了一些不错的内容或者信息，你要给予评论，如果不知道评论什么至少也要点一个
赞。其实发威胁你的朋友，无非是想知道有多少人是在关注他，如果你经常和人家互动，自然会对你产生好感，这个是非常重要的一个行为。经常发布一些违心和你
的朋友进行互动，如点 赞送礼等。
</p>
<p>
	　　5.强推技术这个是要根据不同的朋友而定，一般是比较好的朋友，开玩笑的方式进行销售，这个一定要掌握好一个度，不要太强求，适可而止。
</p>
<p>
	　　6.学会感恩不管是哪个朋友买了，买了多少，你都要感谢人家，并且要当着全世界的人感谢，人家支持你，也许不是因为你的产品好，而是认可你的人，所以
你要知道，他的这次购买，我们是欠他们一个人情，记得哪天你要偿还。一个懂得感恩的人，才能得到人家的尊重和继续的帮助。
</p>
<p>
	　　微信分销增加粉丝
</p>
<p>
	　　1.将QQ好友、手机通讯录的朋友全部加上，这些一般都是认识的朋友、同学、同事、客户等。
</p>
<p>
	　　2.在微博、QQ空间、QQ签名上发布你的微信号，并且隔段时间就宣传一下你的微信号，微博上的朋友都是一些同行朋友。
</p>
<p>
	　　3.多加QQ群，根据你的产品特性加入不同的群。
</p>
<p>
	　　4.根据你自己的特长，还有你的产品，写一些分享类的文章，发布到一些论坛，如果网友觉得你写的不错，自然会加你的微信，想和你交流和学习;如做内衣产品的，可以在女性论坛上发布如何可以保养身材等，总之要让你在网络提高曝光率。
</p>
<p>
	　　5.你把产品送给你一些在微信上有一定影响力的朋友，免费送给他体验，他会帮你分享，可以起到一个宣传你产品的效果，还可以帮你增加好友的一种方式。
</p>
<p>
	　　6.看到你微信上的好友有人推荐他的朋友微信的，你就加，在网上看到和你有关联的微信号，你也加，反正能加就加，因为有人就会有机会销售，不要放过任何一个机会。
</p>
<p>
	　　7.这一种方法也是常见的，最简单的，就是用微信搜附近的人，如果是特产这种产品，在你的当地用这种方式加朋友是非常有效的。
</p>
<p>
	　　8.多参加一些培训、论坛、讲座、交流会等，来这里的朋友都是为了认识更多的人的，所以是一个增加好友的地方。
</p>
<p>
	　　9.互推，找一些关系好，粉丝多的朋友让他帮你在他的微信圈上宣传你，帮你做推广，这也是一个非常好的增加新朋友的方法。
</p>
