DROP TABLE IF EXISTS `weixin_item_attr`;
CREATE TABLE `weixin_item_attr` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `item_id` int(10) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `attr_name` varchar(50) NOT NULL DEFAULT '' COMMENT '分类名',
  `attr_value` varchar(100) NOT NULL DEFAULT '' COMMENT '分类属性',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_item_cate`;
CREATE TABLE `weixin_item_cate` (
  `id` smallint(4) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '分类名',
  `tags` varchar(50) NOT NULL DEFAULT '' COMMENT '标签',
  `pid` smallint(4) unsigned NOT NULL DEFAULT '0' COMMENT '父级',
  `spid` varchar(50) NOT NULL DEFAULT '' COMMENT '所有父级',
  `img` varchar(255) NOT NULL DEFAULT '' COMMENT '分类图片',
  `fcolor` varchar(10) NOT NULL DEFAULT '' COMMENT '标题颜色',
  `remark` text NOT NULL,
  `add_time` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `items` int(10) unsigned NOT NULL DEFAULT '0',
  `likes` int(10) NOT NULL,
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:商品分类 1:标签分类',
