  `itemId` int(11) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `title` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `img` varchar(255) DEFAULT NULL COMMENT '图片',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '商品单价',
  `quantity` int(11) NOT NULL DEFAULT '0' COMMENT '数量',
  `color` varchar(255) DEFAULT NULL COMMENT '颜色',
  `size` varchar(255) DEFAULT NULL COMMENT '规格',
  `zuzhuang` varchar(255) DEFAULT NULL,
  `item_attr` varchar(255) DEFAULT NULL COMMENT '商品属性',
  `itemtype` tinyint(2) DEFAULT NULL COMMENT '商品类型，1完税，0保税',
  `idcname` varchar(18) DEFAULT NULL COMMENT '身份证持卡名',
