DROP TABLE IF EXISTS `weixin_store`;
CREATE TABLE `weixin_store` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '店铺名称',
  `tel` varchar(20) NOT NULL COMMENT '店铺电话',
  `Province` varchar(50) DEFAULT NULL COMMENT '省份',
  `City` varchar(50) DEFAULT NULL COMMENT '城市',
  `Area` varchar(50) DEFAULT NULL COMMENT '地区',
  `address` text NOT NULL COMMENT '店铺地址',
  `info` text NOT NULL COMMENT '店铺介绍',
  `status` tinyint(2) unsigned NOT NULL COMMENT '店铺状态',
  `ordid` tinyint(3) unsigned NOT NULL DEFAULT '255' COMMENT '排序',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_tag`;
CREATE TABLE `weixin_tag` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '标签名',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_topic`;
CREATE TABLE `weixin_topic` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `uname` varchar(20) NOT NULL DEFAULT '' COMMENT '会员名称',
  `content` varchar(255) NOT NULL DEFAULT '' COMMENT '内容',
  `extra` text NOT NULL COMMENT '内容',
  `src_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '引用内容类型',
  `src_id` int(10) unsigned NOT NULL COMMENT '引用内容ID',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0，原创；1，转发；',
  `comments` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '评论数量',
  `forwards` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '转发数量',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_topic_at`;
CREATE TABLE `weixin_topic_at` (
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '原帖ID',
  `tid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '贴ID',
  PRIMARY KEY (`uid`,`tid`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_topic_comment`;
CREATE TABLE `weixin_topic_comment` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `uname` varchar(20) NOT NULL DEFAULT '' COMMENT '会员名称',
  `tid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '贴ID',
  `author_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '作者ID',
  `content` varchar(255) NOT NULL DEFAULT '' COMMENT '评论内容',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_topic_index`;
CREATE TABLE `weixin_topic_index` (
  `uid` int(10) unsigned NOT NULL COMMENT '用户ID',
  `tid` int(10) unsigned NOT NULL COMMENT '信息ID',
  `author_id` int(10) unsigned NOT NULL COMMENT '发布者ID',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加信息',
  KEY `uid` (`uid`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_topic_relation`;
CREATE TABLE `weixin_topic_relation` (
  `tid` int(10) unsigned NOT NULL COMMENT '信息ID',
  `src_tid` int(10) unsigned NOT NULL COMMENT '被引用信息ID',
  `author_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '转发者ID',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '操作类型(1,转发)',
  PRIMARY KEY (`tid`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_user`;
CREATE TABLE `weixin_user` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `uc_uid` int(10) unsigned NOT NULL DEFAULT '0',
  `uid` int(10) NOT NULL DEFAULT '4' COMMENT '会员组',
  `uid_lv` int(11) DEFAULT '1' COMMENT '会员组等级',
  `username` varchar(100) NOT NULL DEFAULT '0' COMMENT '会员名称',
  `name` varchar(26) NOT NULL DEFAULT '' COMMENT '会员名称',
  `nickname` varchar(100) NOT NULL DEFAULT '' COMMENT '会员真实名称',
  `merchant` varchar(255) DEFAULT NULL COMMENT '会员商城名称',
  `m_desc` varchar(255) DEFAULT NULL COMMENT '商城描述',
  `password` varchar(32) NOT NULL DEFAULT '0' COMMENT '密码',
  `phone_mob` varchar(50) NOT NULL DEFAULT '' COMMENT '会员联系方式',
  `qq` int(11) NOT NULL DEFAULT '0' COMMENT 'qq',
  `wechatid` varchar(100) NOT NULL DEFAULT '' COMMENT '微信ID',
  `email` varchar(50) NOT NULL DEFAULT '' COMMENT '邮箱',
  `gender` tinyint(1) DEFAULT '0' COMMENT '1男，0女',
  `birthday` date NOT NULL DEFAULT '0000-00-00' COMMENT '生日',
  `tags` varchar(50) NOT NULL COMMENT '个人标签',
  `intro` varchar(500) NOT NULL DEFAULT '' COMMENT '个人简介',
  `byear` smallint(4) unsigned NOT NULL DEFAULT '0' COMMENT '出生年',
  `bmonth` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '出生月',
  `bday` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '出生日',
  `province` varchar(20) NOT NULL DEFAULT '' COMMENT '省份',
  `city` varchar(20) NOT NULL DEFAULT '' COMMENT '城市',
  `score` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '积分',
  `score_level` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '积分等级',
  `cover` varchar(255) NOT NULL DEFAULT '' COMMENT '头像',
  `reg_ip` varchar(15) NOT NULL DEFAULT '' COMMENT '注册IP',
  `reg_time` int(10) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `last_time` int(10) NOT NULL DEFAULT '0' COMMENT '最后登录时间',
  `ren_time` int(11) DEFAULT '0' COMMENT '最后续费时间',
  `last_ip` varchar(15) DEFAULT '0' COMMENT '最后登录IP',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态0关闭,1开启,2续费',
  `shares` int(10) unsigned DEFAULT '0' COMMENT '分销商上一级会员ID',
  `shares_tree` varchar(255) DEFAULT NULL COMMENT '分销结构树',
  `recom` int(11) DEFAULT '0' COMMENT '推荐卖咖ID',
  `likes` int(10) unsigned DEFAULT '0' COMMENT '喜欢',
  `follows` int(10) unsigned DEFAULT '0' COMMENT '关注',
  `fans` int(10) unsigned DEFAULT '0' COMMENT '粉丝',
  `albums` int(10) unsigned DEFAULT '0' COMMENT '相册',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '地址',
  `daren` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `kaihuhang` int(11) DEFAULT '1' COMMENT '开户行',
  `huming` varchar(100) DEFAULT NULL COMMENT '开户名',
  `zhanghao` varchar(100) DEFAULT NULL COMMENT '帐号',
  `user_account` int(11) NOT NULL DEFAULT '0' COMMENT '用户余额',
  `sheng` varchar(255) DEFAULT NULL COMMENT '省',
  `shi` varchar(255) DEFAULT NULL COMMENT '市',
  `qu` varchar(255) DEFAULT NULL COMMENT '区',
  `follownum` int(11) DEFAULT '0' COMMENT '是否关注微信公众号0为未关注,1为关注',
  `liulan` int(11) DEFAULT '0' COMMENT '店铺浏览数',
  `ll_update` int(11) DEFAULT '0' COMMENT '浏览人数更新时间',
  `hyimg` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
