  `up_disc` varchar(255) DEFAULT NULL COMMENT '升级条件描述',
  `keep` int(11) DEFAULT '0' COMMENT '维持条件',
  `keep1` int(11) DEFAULT '0' COMMENT '维持条件1(直推)',
  `ke_disc` varchar(255) DEFAULT NULL COMMENT '维持条件描述',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_user_fengchengllist`;
CREATE TABLE `weixin_user_fengchengllist` (
  `pingzheng` varchar(255) DEFAULT NULL,
  `kaihuhang` varchar(100) DEFAULT NULL COMMENT '开户行',
  `huming` varchar(50) DEFAULT NULL COMMENT '户名',
  `zhanghao` varchar(100) DEFAULT NULL COMMENT '号账',
  `id` int(30) NOT NULL AUTO_INCREMENT,
  `royalty` decimal(10,2) DEFAULT '1.00' COMMENT '提成率',
  `orderId` varchar(100) DEFAULT '推荐奖' COMMENT '商品订单号',
  `fencheng` decimal(10,2) DEFAULT NULL COMMENT '分成金额',
  `price` decimal(10,2) DEFAULT NULL COMMENT '订单的价格',
  `uid` int(10) NOT NULL COMMENT '获得提成的人的ID',
  `class` int(10) NOT NULL DEFAULT '1' COMMENT 'uid与user_id等级关系',
  `user_id` int(30) NOT NULL COMMENT '购买人ID',
  `add_time` int(10) NOT NULL COMMENT '数据插入时间',
  `state` int(10) NOT NULL DEFAULT '1' COMMENT '状态:0提现成功1未提现2正在提现3待结算',
  `type` int(11) DEFAULT '0' COMMENT '分成类型0为购物,1为推荐',
  `do_time` int(11) DEFAULT '0' COMMENT '处理时间',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_user_fengchenglv`;
CREATE TABLE `weixin_user_fengchenglv` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `royalty` varchar(32) NOT NULL DEFAULT 'NULL' COMMENT '提成率',
  `role_id` tinyint(3) NOT NULL DEFAULT '4' COMMENT '分销商等级',
  `status` int(11) DEFAULT '0' COMMENT '0表示开启,1表示不开启',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_user_follow`;
CREATE TABLE `weixin_user_follow` (
  `uid` int(10) unsigned NOT NULL COMMENT '用户ID',
  `follow_uid` int(10) unsigned NOT NULL COMMENT '被关注者ID',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `mutually` tinyint(1) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`uid`,`follow_uid`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_user_lvdown`;
CREATE TABLE `weixin_user_lvdown` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userid` tinyint(3) DEFAULT NULL COMMENT '降级代理ID',
  `username` varchar(255) DEFAULT NULL COMMENT '代理名称',
  `add_time` int(11) DEFAULT '0' COMMENT '降级信息生成时间',
  `status` tinyint(3) DEFAULT '0' COMMENT '状态,0未处理,1降级,2不降级',
  `keep` int(11) DEFAULT '0' COMMENT '维持条件(总数)',
  `keep1` int(11) DEFAULT '0' COMMENT '维持条件(直推)',
  `num` int(11) DEFAULT '0' COMMENT '上个月推荐总人数',
  `num1` int(11) DEFAULT '0' COMMENT '上月直推人数',
  `phone_mob` varchar(32) DEFAULT NULL COMMENT '联系方式',
  `do_time` int(11) DEFAULT NULL COMMENT '受理时间',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_user_lvup`;
CREATE TABLE `weixin_user_lvup` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `useruid` tinyint(3) DEFAULT '3' COMMENT '申请人用户组',
  `userid` int(11) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `username` varchar(255) DEFAULT NULL COMMENT '用户名',
  `phone_mob` int(11) DEFAULT NULL COMMENT '联系方式',
  `upgrade` int(11) DEFAULT '0' COMMENT '升级条件(总数)',
  `upgrade1` int(11) DEFAULT '0' COMMENT '升级条件(直推)',
  `num` int(11) DEFAULT '0' COMMENT '上月团队新增(总数)',
  `num1` int(11) DEFAULT '0' COMMENT '上月团队新增人数(直推)',
  `up_user` int(11) DEFAULT '0' COMMENT '上级ID',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `hq_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '总部处理状态0未处理,1同意,2不同意',
  `up_time` int(11) DEFAULT NULL COMMENT '更新时间',
  `up_status` tinyint(3) DEFAULT '0' COMMENT '上级处理情况0未处理,1同意,2不同意',
  `hq_time` int(11) DEFAULT '0' COMMENT '后台处理时间',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_user_msgtip`;
CREATE TABLE `weixin_user_msgtip` (
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1:关注，2:提到，3:私信，4:通知',
  `num` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '次数',
  PRIMARY KEY (`uid`,`type`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_user_ordermsg`;
CREATE TABLE `weixin_user_ordermsg` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dl_id` int(11) NOT NULL DEFAULT '0' COMMENT '代理商ID',
  `jm_id` int(11) NOT NULL DEFAULT '0' COMMENT '加盟商ID',
  `addr_id` int(11) NOT NULL DEFAULT '0' COMMENT '地址ID',
  `iteminfo` varchar(256) NOT NULL DEFAULT '' COMMENT '商品信息',
  `orderid` varchar(32) NOT NULL DEFAULT '' COMMENT '排序方式',
  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '状态',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_user_stat`;
CREATE TABLE `weixin_user_stat` (
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `action` varchar(20) NOT NULL DEFAULT '' COMMENT '动作',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '次数',
  `last_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后一次操作时间',
  UNIQUE KEY `uid_type` (`uid`,`action`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_words`;
CREATE TABLE `weixin_words` (
  `id` mediumint(6) NOT NULL AUTO_INCREMENT,
  `tel` varchar(255) NOT NULL DEFAULT '' COMMENT '联系方式',
  `words_txt` varchar(255) NOT NULL DEFAULT '' COMMENT '内容',
  `user_name` varchar(50) NOT NULL DEFAULT '' COMMENT '会员名称',
  `add_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '添加时间',
  `email` varchar(50) NOT NULL DEFAULT '' COMMENT '邮箱',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_zhuanpan_config`;
CREATE TABLE `weixin_zhuanpan_config` (
  `id` int(6) NOT NULL AUTO_INCREMENT,
  `hd_name` varchar(255) NOT NULL DEFAULT '' COMMENT '活动名称',
  `hd_duijiang_info` varchar(255) NOT NULL DEFAULT '' COMMENT '兑换信息',
  `hd_chongfu_info` varchar(255) NOT NULL DEFAULT '' COMMENT '重复抽奖提示',
  `hd_end_info` varchar(255) NOT NULL DEFAULT '' COMMENT '活动结束提示',
  `hd_renshu` varchar(255) NOT NULL DEFAULT '' COMMENT '活动人数',
  `hd_cishu` int(11) NOT NULL DEFAULT '0' COMMENT '活动次数',
  `hd_info` varchar(255) NOT NULL DEFAULT '' COMMENT '活动内容',
  `hd_begin_time` int(11) NOT NULL DEFAULT '0' COMMENT '活动开始时间',
  `hd_end_time` int(11) NOT NULL DEFAULT '0' COMMENT '活动结束时间',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_zhuanpan_list`;
CREATE TABLE `weixin_zhuanpan_list` (
  `id` mediumint(6) NOT NULL AUTO_INCREMENT,
  `praisename` varchar(255) DEFAULT NULL COMMENT '获奖等级',
  `praisecontent` varchar(255) DEFAULT NULL COMMENT '奖品名称',
  `chance` varchar(11) DEFAULT NULL COMMENT '机率',
  `shuliang` varchar(255) DEFAULT NULL COMMENT '数量',
  `min` int(11) DEFAULT NULL COMMENT '最小角度',
  `max` int(11) DEFAULT NULL COMMENT '最大角度',
  `praisenumber` int(11) DEFAULT NULL COMMENT '奖品数量',
  `uid` int(11) DEFAULT NULL COMMENT '所属活动ID',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `weixin_zhuanpan_log`;
CREATE TABLE `weixin_zhuanpan_log` (
  `username` varchar(255) NOT NULL DEFAULT '' COMMENT '会员名称',
  `userid` int(11) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `snid` varchar(255) NOT NULL DEFAULT '' COMMENT '验证码',
  `listid` int(11) NOT NULL,
  `jp_leibei` varchar(255) NOT NULL DEFAULT '' COMMENT '获奖等级',
  `jp_name` varchar(255) NOT NULL DEFAULT '' COMMENT '奖品名称',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '发放情况',
  `do_time` int(11) NOT NULL DEFAULT '0' COMMENT '发放时间',
  `addtime` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `u_phone` varchar(255) NOT NULL DEFAULT '' COMMENT '会员联系方式',
  `u_name` varchar(255) NOT NULL DEFAULT '' COMMENT '收货人',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
